INSERT INTO `books` (`BookID`, `Title`, `Author`, `Bio`, `Description`, `RentedTo`, `ImageBlob`) VALUES
	(1, '12 Rules For Life: An Antidote to Chaos', 'Jordan B. Peterson', 'Jordan Bernt Peterson is a Canadian clinical psychologist, YouTube personality, author, and a professor emeritus at the University of Toronto. Peterson began to receive widespread attention as a public intellectual in the late 2010s for his views on cultural and political issues, often described as conservative.', '#1 NATIONAL BESTSELLER.<br>#1 INTERNATIONAL BESTSELLER.<br>What does everyone in the modern world need to know? <br> Renowned psychologist Jordan B. Peterson\'s answer to this most difficult of questions uniquely combines the hard-won truths of ancient tradition with the stunning revelations of cutting-edge scientific research.<br>Humorous, surprising and informative, Dr. Peterson tells us why skateboarding boys and girls must be left alone, what terrible fate awaits those who criticize too easily, and why you should always pet a cat when you meet one on the street.<br>What does the nervous system of the lowly lobster have to tell us about standing up straight (with our shoulders back) and about success in life? Why did ancient Egyptians worship the capacity to pay careful attention as the highest of gods? What dreadful paths do people tread when they become resentful, arrogant and vengeful?<br>Dr. Peterson journeys broadly, discussing discipline, freedom, adventure and responsibility, distilling the world\'s wisdom into 12 practical and profound rules for life. 12 Rules for Life shatters the modern commonplaces of science, faith and human nature, while transforming and ennobling the mind and spirit of its readers.', '0', _binary ),
	(2, 'Beyond Order: 12 More Rules For Life', 'Jordan B. Peterson', 'Jordan Bernt Peterson is a Canadian clinical psychologist, YouTube personality, author, and a professor emeritus at the University of Toronto. Peterson began to receive widespread attention as a public intellectual in the late 2010s for his views on cultural and political issues, often described as conservative.', 'In 12 Rules for Life, clinical psychologist and celebrated professor at Harvard and the University of Toronto Dr. Jordan B. Peterson helped millions impose order on the chaos of their lives. Now, in this bold sequel, Peterson delivers 12 more lifesaving principles for resisting the exhausting toll that our desire to order the world inevitably takes. \n\n In a time when the human will increasingly imposes itself over every sphere of life - from our social structures to our emotional states - Peterson warns that too much security is dangerous. What’s more, he offers strategies for overcoming the cultural, scientific, and psychological forces causing us to tend toward tyranny, and teaches us how to rely instead on our instinct to find meaning and purpose, even - and especially - when we find ourselves powerless. \n While chaos, in excess, threatens us with instability and anxiety, unchecked order can petrify us into submission. \n\n Beyond Order provides a call to balance these two fundamental principles of reality itself and guides us along the straight and narrow path that divides them.', '0', _binary ),
	(3, 'Man\'s Search For Meaning', 'Viktor E. Frankl', 'Viktor Emil Frankl was an Austrian neurologist, psychiatrist, philosopher, writer, and Holocaust survivor. He was the founder of logotherapy, a school of psychotherapy that describes a search for a life\'s meaning as the central human motivational force.', 'Psychiatrist Viktor Frankl\'s memoir has riveted generations of readers with its descriptions of life in Nazi death camps and its lessons for spiritual survival. Between 1942 and 1945 Frankl labored in four different camps, including Auschwitz, while his parents, brother, and pregnant wife perished. Based on his own experience and the experiences of others he treated later in his practice, Frankl argues that we cannot avoid suffering but we can choose how to cope with it, find meaning in it, and move forward with renewed purpose. Frankl\'s theory-known as logotherapy, from the Greek word logos ("meaning")-holds that our primary drive in life is not pleasure, as Freud maintained, but the discovery and pursuit of what we personally find meaningful.\n\nAt the time of Frankl\'s death in 1997, Man\'s Search for Meaning had sold more than 10 million copies in twenty-four languages. A 1991 reader survey for the Library of Congress that asked readers to name a "book that made a difference in your life" found Man\'s Search for Meaning among the ten most influential books in America.', '0', _binary ),
	(12, 'You Are Your Own Gym', 'Mark Lauren', 'Mark Lauren has used bodyweight exercises to create society’s leanest, strongest, most confident people. He honed his method while preparing nearly a thousand trainees for the extreme demands of the most elite levels of the U.S. Special Operations. Now he provides everyday Joes and Janes with his training tools to achieve elite fitness anywhere anytime.', 'As the demand for Special Operations military forces has grown over the last decade, elite trainer Mark Lauren has been at the front lines of preparing nearly one thousand soldiers, getting them lean and strong in record time. Now, for regular Joes and Janes, he shares the secret to his amazingly effective regimen—simple exercises that require nothing more than the resistance of your own bodyweight to help you reach the pinnacle of fitness and look better than ever before.<br><br>Armed with Mark Lauren’s motivation techniques, expert training, and nutrition advice, you’ll see rapid results by working out just thirty minutes a day, four times a week—whether in your living room, yard, garage, hotel room, or office. Lauren’s exercises build more metabolism-enhancing muscle than weightlifting, burn more fat than aerobics, and are safer than both, since bodyweight exercises develop balance and stability and therefore help prevent injuries. Choose your workout level—Basic, 1st Class, Master Class,and Chief Class—and get started, following the clear instructions for 125 exercises that work every muscle from your neck to your ankles. Forget about gym memberships, free weights, and infomercial contraptions. They are all poor substitutes for the world’s most advanced fitness machine, the one thing you are never without: your own body.', '0', _binary ),
	(13, 'Eat That Frog!', 'Brian Tracy', 'Brian Tracy is a Canadian-American motivational public speaker and self-development author. He is the author of over eighty books that have been translated into dozens of languages. His popular books are Earn What You\'re Really Worth, Eat That Frog!, No Excuses!', 'There’s an old saying that if the first thing you do each morning is eat a live frog, you’ll have the satisfaction of knowing you’re done with the worst thing you’ll have to do all day. For Tracy, eating a frog is a metaphor for tackling your most challenging task—but also the one that can have the greatest positive impact on your life.<br><br>Eat That Frog! shows you how to organize each day so you can zero in on these critical tasks and accomplish them efficiently and effectively. The core of what is vital to effective time management is: decision, discipline, and determination. And in this fully revised and updated edition, Tracy adds two new chapters. The first explains how you can use technology to remind yourself of what is most important and protect yourself from what is least important. The second offers advice for maintaining focus in our era of constant distractions, electronic and otherwise.<br><br>This life-changing book will ensure that you get more of your important tasks done today.', '0', _binary ),
	(14, 'The Power Of Habit', 'Charles Duhigg', 'Charles Duhigg is an American journalist and non-fiction author. He was a reporter for The New York Times, currently writes for The New Yorker Magazine and is the author of two books on habits and productivity, titled The Power of Habit: Why We Do What We Do in Life and Business and Smarter Faster Better.', 'NEW YORK TIMES BESTSELLER • This instant classic explores how we can change our lives by changing our habits.<br><br>NAMED ONE OF THE BEST BOOKS OF THE YEAR BY The Wall Street Journal • Financial Times<br><br>In The Power of Habit, award-winning business reporterCharles Duhigg takes us to the thrilling edge of scientific discoveries that explain why habits exist and how they can be changed. Distilling vast amounts of information into engrossing narratives that take us from the boardrooms of Procter & Gamble to the sidelines of the NFL to the front lines of the civil rights movement, Duhigg presents a whole new understanding of human nature and its potential. At its core, The Power of Habit contains an exhilarating argument: The key to exercising regularly, losing weight, being more productive, and achieving success is understanding how habits work. As Duhigg shows, by harnessing this new science, we can transform our businesses, our communities, and our lives.', '0', _binary ),
	(15, 'The 7 Habits Of Highly Effective People', 'Stephen R. Covey', 'Stephen Richards Covey was an American educator, author, businessman, and keynote speaker. His most popular book is The 7 Habits of Highly Effective People. His other books include First Things First, Principle-Centered Leadership, The 7 Habits of Highly Effective Families, The 8th Habit, and The Leader In Me: How Schools and Parents Around the World Are Inspiring Greatness, One Child at a Time. <br>In 1996, Time magazine named him one of the 25 most influential people. He was a professor at the Jon M. Huntsman School of Business at Utah State University at the time of his death.', 'One of the most inspiring and impactful books ever written, The 7 Habits of Highly Effective People has captivated listeners for nearly three decades. It has transformed the lives of presidents and CEOs, educators and parents - millions of people of all ages and occupations. Now, this 30th anniversary edition of the timeless classic commemorates the wisdom of the 7 Habits with modern additions from Sean Covey. <br><br>The 7 Habits have become famous and are integrated into everyday thinking by millions and millions of people. Why? Because they work! With Sean Covey’s added takeaways on how the habits can be used in our modern age, the wisdom of the 7 Habits will be refreshed for a new generation of leaders. <br><br>This beloved classic presents a principle-centered approach for solving both personal and professional problems. With penetrating insights and practical anecdotes, Stephen R. Covey reveals a step-by-step pathway for living with fairness, integrity, honesty, and human dignity - principles that give us the security to adapt to change and the wisdom and power to take advantage of the opportunities that change creates. ', '0', _binary ),
	(16, 'On Becoming a Person', 'Carl R. Rogers', 'Carl Ransom Rogers was an American psychologist and among the founders of the humanistic approach (and client-centered approach) in psychology. Rogers is widely considered to be one of the founding fathers of psychotherapy research and was honored for his pioneering research with the Award for Distinguished Scientific Contributions by the American Psychological Association (APA) in 1956.', 'In this book, one of America\'s most distinguished psychologists describes his experiences in helping people to discover the path to personal growth through an understanding of their own limitations and potential. What is personal growth? Under what conditions is it possible? How can one person help another? What is creativity, and how can it be fostered? These are some of the issues raised, which challenge many concepts of traditional psychology.<br><br>Contemporary psychology derives largely from the experimental laboratory, or from Freudian theory. It is preoccupied with minute aspects of animal and human behaviour, or with the mentally ill. But there are rebels, of whom the author counts himself as one, along with Gordon Allport, Abraham Maslow and Rollo May, who feel that psychology and psychiatry should be aiming higher, and be more concerned with growth and potentiality in man. The interest of such a psychology is in the production of harmoniously mature individuals, given that we all have qualities and possibilities infinitely capable of development. Successful development makes us more flexible in relationships, more creative, and less open to suggestion and control.', '0', _binary );

